  <style>
    html,
    body {
      margin: 0;
      height: 100%;
      background-color: #e2dfdf;
      overflow: hidden;
    }
    #fullpage {
      position: absolute;
      width: 100%;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      background-color: #f3eeee;
      opacity: 1;
      transition: 1s opacity;
    }
    #fullpage.fade-out {
      opacity: 0;
    }
    #loader-container {
      position: absolute;
      width: 100%;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
    }
    #loader-background-image {
      width: 15vw;
    }
    .loader {
        display: inline-grid;
        width: 90px;
        aspect-ratio: 1;
        clip-path: polygon(100% 50%, 85.36% 85.36%, 50% 100%, 14.64% 85.36%, 0% 50%, 14.64% 14.64%, 50% 0%, 85.36% 14.64%);
        background: #574951;
        animation: l1 6s infinite linear;
      }
      .loader:before,
      .loader:after {
        content: "";
        grid-area: 1/1;
        background: #83988E;
        clip-path: inherit;
        margin: 10%;
        animation: inherit;
        animation-duration: 12s;
      }
      .loader:after {
        background: #BCDEA5;
        margin: 20%;
        animation-duration: 18s;
      }
      @keyframes l1 {
        to {
          rotate: 1turn
        }
      }
    @media (orientation: portrait) {
      #loader-background-image {
        width: 30vw;
        height: auto;
      }
    }
  </style>

    </div>
